import React, { useState, useCallback } from 'react';
import { Container, Row, Col } from 'reactstrap';
import FormSignUp  from '../../modules/components/form/FormSignUp.js';

const SignUp = (props) => {

    const [theme,setTheme] = useState(props.theme);

    const handleThemeChange = useCallback((current_theme) => {
        setTheme(current_theme);
      },[setTheme]);

    return (
        <div className={"App Sign_up "+theme}>
            <Container>
                <Row>
                    <Col xs="6"></Col>
                    <Col xs="6">
                        <h1 className="display-3">Welcome to PINLY</h1>
                        <p className="lead">PINLY is an application for sleep monitoring just for you.</p>
                        <FormSignUp></FormSignUp>
                    </Col>
                </Row>

            </Container>

        </div>
    );
}

export default SignUp;
